2	Startups test	startups-test	<div><img src="data:image/jpeg;base64,"><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;"><br></span></font></div><div><div><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;">Udacity, an online learning start-up founded by a pioneer of self-driving cars, is finally taking the wraps off a job trial program it has worked on for the last year with 80 small companies.</span></font></div><div><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;"><br></span></font></div><div><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;">The program, called Blitz, provides what is essentially a brief contract assignment, much like an internship. Employers tell Udacity the skills they need, and Udacity suggests a single candidate or a few. For the contract assignment, which usually lasts about three months, Udacity takes a fee worth 10 to 20 percent of the worker’s salary. If the person is then hired, Udacity does not collect any other fees, such as a finder’s fee.</span></font></div><div><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;"><br></span></font></div><div><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;">For small start-ups, a hiring decision that goes bad can be a time-consuming, costly distraction. “This lets companies ease their way into hiring without the hurdle of making a commitment upfront,” said Sebastian Thrun, co-founder and chairman of Udacity.</span></font></div><div><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;"><br></span></font></div><div><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;">When Udacity started four years ago, there were predictions it could transform higher education. But in recent years it has homed in on filling the high-tech skills gap.</span></font></div><div><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;"><br></span></font></div><div><font face="georgia, times new roman, times, serif"><span style="font-size: 10.625px;">Half a million tech jobs went unfilled last year. By 2020, there will be 1.4 million computer-science-related jobs in America, and only 400,000 computer science graduates to fill them, according to government statistics and think-tank projections.</span></font></div></div>	2016-11-18 17:14:55.935541	0
